import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="container p-3.5 bg-white text-slate-900">
          <section className='max-w-screen-md mx-auto'>
            <h2 className='text-white bg-slate-500 font-bold text-center'>Registration form</h2>
          </section>
       </header>
    </div>
  );
}

export default App;
